INSERT INTO meta_address_type(id,value,code,code_hl7,value_order,description) values ('metaAddressType:home','metaLabel:home','H','H','1','A communication address at a home, attempted contacts for business purposes might intrude privacy and chances are one will contact family or other household members instead of the person one wishes to call. Typically used with urgent cases, or if no other contacts are available.'),('metaAddressType:mailing','metaLabel:mailing','PST','M','2','Used to send mail.'),('metaAddressType:temporary','metaLabel:temporary','TMP','C','3','A temporary address, may be good for visit or mailing. Note that an address history can provide more detailed information.'),('metaAddressType:business','metaLabel:business','WP','B','4','An office address. First choice for business related contacts during business hours.'),('metaAddressType:bad','metaLabel:badadd','BAD','BA','5','A flag indicating that the address is bad, in fact, useless.'),('metaAddressType:confidentialAddress','metaLabel:confidentialAddress','CONF','CONF','6','Indicates that the address is considered sensitive and should only be shared or published in accordance with organizational controls governing patient demographic. information with increased sensitivity. Uses of Addresses. Lloyd to supply more complete description.'),('metaAddressType:primaryHome','metaLabel:primaryHome','HP','HP','7','The primary home, to reach a person after business hours.'),('metaAddressType:vacationHome','metaLabel:vacationHome','HV','HV','8','A vacation home, to reach a person while on vacation.'),('metaAddressType:old','metaLabel:old','OLD','OLD','9','This address is no longer in use.Usage Note: Address may also carry valid time ranges.This code is used to cover the situations where it is known that the address is no longer valid, but no particular time range for its use is known.'),('metaAddressType:temporaryAddress','metaLabel:temporaryAddress','TMP','TMP','10','A temporary address, may be good for visit or mailing. Note that an address history can provide more detailed information.'),('metaAddressType:workPlace','metaLabel:workPlace','WP','WP','11','An office address. First choice for business related contacts during business hours.'),('metaAddressType:direct','metaLabel:direct','DIR','DIR','12','Indicates a work place address or telecommunication address that reaches the individual or organization directly without intermediaries. For phones, often referred to as a ''private line''.'),('metaAddressType:public','metaLabel:public','PUB','PUB','13','Indicates a work place address or telecommunication address that is a ''standard'' address which may reach a reception service, mail-room, or other intermediary prior to the target entity.'),('metaAddressType:physicalVisitAddress','metaLabel:physicalVisitAddress','PHYS','PHYS','14','Used primarily to visit an address.'),('metaAddressType:postalAddress','metaLabel:postalAddress','PST','PST','15','Used to send mail.'),('metaAddressType:answeringService','metaLabel:answeringService','AS','AS','16','An automated answering machine used for less urgent cases and if the main purpose of contact is to leave a message or access an automated announcement.'),('metaAddressType:emergencyContact','metaLabel:emergencyContact','EC','EC','17','A contact specifically designated to be used for emergencies. This is the first choice in emergencies, independent of any other use codes.'),('metaAddressType:mobileContact','metaLabel:mobileContact','MC','MC','18','A telecommunication device that moves and stays with its owner. May have characteristics of all other use codes, suitable for urgent matters, not the first choice for routine business.'),('metaAddressType:pager','metaLabel:pager','PG','PG','19','A paging device suitable to solicit a callback or to leave a very short message.');
